// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

interface IMintContract{
    function balanceOf(address account) external view returns (uint256);
}

contract AMM{
    struct Listing{
        address seller;
        uint256 amount;
        uint256 pricePerCCT;
        bool active;
    }

    Listing[] public listings ;
    IMintContract public mintContract;

    constructor(address _mintContract){
        mintContract=IMintContract(_mintContract);
    }
    
    function listTokens(uint256 _amount, uint256 _price) external {
        require(mintContract.balanceOf(msg.sender) >= _amount, "Not enough CCT tokens");

        listings.push(Listing({
            seller: msg.sender,
            amount: _amount,
            pricePerCCT: _price,
            active: true
        }));
    }
}
